const scheduleBody = document.querySelector('.point-body');
const scheduleBodyText = document.querySelector('.point-text');
const scheduleBodySpan = document.querySelector('.point-text > span');
const scheduleBodyWidth = scheduleBody.offsetWidth;
const scheduleBodyHeight = scheduleBody.offsetHeight;
 console.log(scheduleBodyHeight)

new Chartist.Line('.point-body', {
  labels: ['2012', '2013', '2014', '2015', '2016', '2017', '2018', '2019', '2020', '2021'],
  series: [{
    name: 'points-1',
    data:[35, 135, 140, 70, 7, 60, 230, 125, 90, 10]
  }, {
    name: 'points-2',
    data: [135, 235, 40, 10, 107, 160, 130, 25, 20, 150]
  }],
}, {
  axisX: {
    showGrid: true,
    showLabel: true
  },
  width: 100 + "%",
  series: {
    'points-1': {
      lineSmooth: Chartist.Interpolation.simple(),
      showArea: true,
      lineSmooth: false,
    },
    'points-2': {
      lineSmooth: Chartist.Interpolation.simple(),
      showArea: true,
      lineSmooth: false,
    },
  }
});

scheduleBody.onmouseover = scheduleBody.onmouseout = handler;

function handler(e){
  var dots = document.querySelectorAll('.ct-point');
  for (let i = 0; i < dots.length; i++) {
    const dot = dots[i];
    if ((e.type == 'mouseover') && (e.target == dot)) {
      scheduleBodyText.classList.add('active');
      let scheduleCoord = scheduleBody.getBoundingClientRect()
      let coord = dot.getBoundingClientRect()

      // console.log(coord, coord.top / 2)

      let nuber = dot.getAttribute('ct:value')
      let ifValue_1 = scheduleBodyWidth / 2 > coord.left - scheduleCoord.left
      let ifValue_2 = scheduleBodyWidth / 2 < coord.left - scheduleCoord.left
      let ifValue_3 = scheduleBodyHeight / 2 > coord.top - scheduleCoord.top
      let ifValue_4 = scheduleBodyHeight / 2 < coord.top - scheduleCoord.top
      if (ifValue_1 && ifValue_3){
        console.log(1)
        scheduleBodyText.style.cssText = `
          left: ${coord.left - scheduleCoord.left}px; 
          top: ${coord.top - scheduleCoord.top}px;
          transform: translate(-30%, 10px));
        `
      } else if(ifValue_1 && ifValue_4) {
        console.log(2)
        scheduleBodyText.style.cssText = `
          left: ${coord.left - scheduleCoord.left}px; 
          top: ${coord.top - scheduleCoord.top}px; 
          transform: translate(-30%, calc(-100% - 10px));
        `
      } else if (ifValue_2 && ifValue_3) {
        console.log(3)
        scheduleBodyText.style.cssText = `
          left: ${coord.left - scheduleCoord.left}px; 
          top: ${coord.top - scheduleCoord.top}px;
          transform: translate(-95%, 10px);
        `
      } else {
        console.log(4)
        scheduleBodyText.style.cssText = `
          left: ${coord.left - scheduleCoord.left}px; 
          top: ${coord.top - scheduleCoord.top}px;
          transform: translate(-95%, calc(-100% - 10px));
        `
      }
      if (e.target.closest('.ct-series.ct-series-a')) {
        let text = scheduleBody.dataset.text_1;
        scheduleBodyText.innerHTML = `<p>${text}</p> <span>${nuber}</span>`;
      } else {
        let text = scheduleBody.dataset.text_2;
        scheduleBodyText.innerHTML = `<p>${text}</p> <span>${nuber}</span>`;
      }
    }
    if (e.type == 'mouseout')  {
      scheduleBodyText.classList.remove('active');
    }
  }
}
